import { isMobile } from "./helpers.js";
import {
  html,
  renderComponent,
  useState,
  useEffect,
} from "./utils/preact-htm.js";

const containerId = "vis-seasonality-timeline";

export function renderSeasonalityTimeline() {
  let containerElement = document.querySelector(`#${containerId}`);

  if (containerElement) {
    // clear existing content before rendering
    containerElement.innerHTML = "";

    // Render ButtonGroup as a component so hooks work
    renderComponent(html`<${SeasonalityTimeline} />`, containerElement);
  } else {
    console.error(
      `Could not find container element for seasonality timeline with id ${containerId}`
    );
  }
}

